import axios from 'axios';
import React, { useState } from 'react'
import {Link,} from 'react-router-dom'
function Category(){

  let[data, setData] = useState({
    id:"",
    srno: 0,
    name:"",
    image:""
  });

  function e(e){
    e.preventDefault();
    let newData = {...data};
    newData[e.target.id] = e.target.value;
    setData(newData);
  };

  function save(e){
    e.preventDefault()
  }

    return(

        <div>
     <hr class='container'/>
       <div class="breadcrumbs">
		<p class="bread"><span><Link to="/administration">Admin</Link></span> / <span> <Link to="/administration/productcategories"> Product Categories </Link></span>/<span> Product Category</span></p>
        <h1 class='text-center bg-light'>Add Category</h1>
		</div>
     
 <div class="container">
      <div class="row">
        <div class="col-xxl-8 col-10 col-md-8 mx-auto">
          <form action="">
            
            
            <div class="mb-3">
            <label for="srno">Sr No</label>
            <input class="form-control" type="number" min="1"  id="srno" />
            </div>

            <div class="mb-3">
              <label for="exampleInputPassword1" class="form-label">Category Name</label>
              <input type="text" class="form-control" id="name" placeholder="Enter Category name"
                name="name"/>
            </div>

            <div class="mb-3">
            <label for="image">Image</label>
            <input type="text"  class="form-control" id="image" />
            <button type="submit" class="btn btn-primary" >Save</button>
            </div>
          </form>
        </div>
      </div>
    </div>


    </div>
    )
}
export default Category;
